import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import "./css/navigation.css";
import {Avatar} from 'antd';

const navLinks=[
    {
        title: "Home",
        path: '/home'
    },
    {
        title: 'Blog',
        path: '/blog'
    },
    {
        title: 'Contact Us',
        path: '/contact-us'
    }
];

function Navigation({user}){
    return(
    <div className='navigation-bar'>
    <div className="container">
   <nav className="navbar navbar-expand-lg navbar-light d-flex py-3">
    <a className="navbar-brand" href="/">MiniBlog</a>
    {/* <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation"> */}
      <span className="navbar-toggler-icon"></span>
    {/* </button> */}
    {/* <div className="collapse navbar-collapse" id="navbarNavAltMarkup"> */}
      <div className="navbar-nav">
      {
        navLinks.map((link,index)=>{
           return <a key={index} className="nav-item nav-link" href={link.path}>{link.title}</a>
        })
      }
          <div className="d-lg-none">
                <a className="nav-item nav-link" href="/login">Login</a>
                <a className="nav-item nav-link" href="/sign-up">Sign Up</a>
          </div>
      </div>
      
      <div className=' buttons navbar-nav d-lg-flex d-none d-lg-block align-items-center' >
       <a className=" button nav-item nav-link me-2"> <button type="button" className="btn btn-outline-dark">Login</button> </a>
       <a className="button nav-item nav-link">  <button type="button" className="btn btn-dark">Sign Up</button> </a>
      </div>
    {/* </div> */}
    <div>
      <Avatar src='https://gw.alipayobjects.com/zos/rmsportal/KDpgvguMpGfqaHPjicRK.svg' />
      <span className='menu-avatar-name'>{`${user.firstName} ${user.lastName}`}</span>
    </div>
</nav>
</div>
</div>
    )
}

export default Navigation;
